"use strict";

/**
 * Handle common UI components
 */

var API_URL = 'https://yts.mx/api/v2/list_movies.json';
window.addEventListener('load', function (e) {
  // Video player load
  var videoPlayerOverlay = document.querySelector('#video-player .overlay');
  if (videoPlayerOverlay) {
    videoPlayerOverlay.style.display = 'none';
  }

  // Load movie poster
  /*
  const movieCovers = document.querySelectorAll('#movie_cover')
  if(movieCovers){
      movieCovers.forEach(cover => {
          if(!cover.onerror){
              cover.src = cover.dataset.img
          }
      })
  }
  */

  // Prevent submiting empty search form
  var searchForm = document.querySelectorAll('#search-form');
  if (searchForm) {
    searchForm.forEach(function (form) {
      form.addEventListener('submit', function (e) {
        var formdata = new FormData(e.target);
        if (!formdata.get('search') && !formdata.get('order')) {
          e.preventDefault();
        }
      });
    });
  }

  // Movie suggestion on search
  var searchInput = document.querySelector('#search');
  if (searchInput) {
    var awesomplete = new Awesomplete(searchInput, {
      minChars: 2,
      maxItems: 5
    });
    searchInput.addEventListener('input', function () {
      fetch("".concat(API_URL, "?limit=", 5, "&query_term=").concat(searchInput.value)).then(function (res) {
        return res.json();
      }).then(function (data) {
        var _data$data;
        var movies = data === null || data === void 0 ? void 0 : (_data$data = data.data) === null || _data$data === void 0 ? void 0 : _data$data.movies;
        if (movies != undefined && movies.length > 0) {
          var movieTitles = movies.map(function (movie) {
            return movie.title;
          });
          awesomplete.list = movieTitles;
        }
      });
    });
  }

  // Movies carousel display
  var owlCarousel = $('.owl-carousel');
  if (owlCarousel) {
    owlCarousel.owlCarousel({
      dots: false,
      nav: true,
      loop: true,
      margin: 10,
      lazyLoad: true,
      responsiveClass: true,
      responsive: {
        0: {
          items: 2,
          nav: true,
          loop: false
        },
        600: {
          items: 4,
          nav: true,
          loop: false
        },
        1000: {
          items: 6,
          nav: false,
          loop: false,
          margin: 30
        }
      }
    });
  }
});